import Embed from "./Embed.js"
import {Links} from "./ProjectData"

import currentLinks from "./currentLinks.js";

import Header from "./Header.js"

export default function JamLink() {
    return (
 
  <div>
     <Header type = {"UX/UI Design"} title = {"JamLink"} desc = {"View Prototype"} src = {"./content/Images-JamLink/jamLink.jpg"} link = {"https://www.figma.com/proto/MUQPWZrCKchjPh5e3rMP3R/Portfolio?node-id=205%3A6323&page-id=205%3A5634&scaling=min-zoom&show-proto-sidebar=1&starting-point-node-id=205%3A6895&viewport=864%2C640%2C0.17"}/>
     <div className = "page-content">
      <div className = "content-flex">
        <currentLinks />
      </div>
     </div>
  </div>
    );
   
}
